import React from 'react'
import usericon from "../resources/userIcon.jpeg"
export default function AdminEditPage() {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    bio: '',
    location: '',
    profession: '',
    skills: '',
});

const [submitted, setSubmitted] = useState(false); // State to check if form is submitted

// Handle input changes
const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
        ...formData,
        [name]: value,
    });
};

// Handle form submission
const handleSubmit = (e) => {
    e.preventDefault();
    // Form validation logic can go here (e.g., checking for empty fields, valid phone number, etc.)
    setSubmitted(true);
    console.log(formData);
};
  return (
    <div style={{ marginLeft: '5%', marginRight: '5%', backgroundColor: 'skyblue', borderRadius: '0.6rem', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent:'space-between'  }} >
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <h1> Profile Info </h1>
        <img src={usericon} style={{ height: '15%', width: '15%', borderRadius: '50%' }} />
        <label htmlFor="inputefile"> Upload Photo</label>
        <input type="file" accept='image/jpg, image/jpeg, image/png, image/webp' id='inputefile' />
        <p></p>
        <p></p>
        <div className="container mt-5">
            <h2>Registration Form</h2>
            <form onSubmit={handleSubmit}>
                {/* Name Field */}
                <div className="mb-3">
                    <label htmlFor="name" className="form-label">Name</label>
                    <input
                        type="text"
                        className="form-control"
                        id="name"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                        required
                    />
                </div>

                {/* Phone Number Field */}
                <div className="mb-3">
                    <label htmlFor="phone" className="form-label">Phone Number</label>
                    <input
                        type="tel"
                        className="form-control"
                        id="phone"
                        name="phone"
                        value={formData.phone}
                        onChange={handleChange}
                        required
                    />
                </div>

                {/* Bio Field */}
                <div className="mb-3">
                    <label htmlFor="bio" className="form-label">Bio</label>
                    <textarea
                        className="form-control"
                        id="bio"
                        name="bio"
                        value={formData.bio}
                        onChange={handleChange}
                        rows="3"
                        required
                    ></textarea>
                </div>

                {/* Location Field */}
                <div className="mb-3">
                    <label htmlFor="location" className="form-label">Location</label>
                    <input
                        type="text"
                        className="form-control"
                        id="location"
                        name="location"
                        value={formData.location}
                        onChange={handleChange}
                        required
                    />
                </div>

                {/* Profession Field */}
                <div className="mb-3">
                    <label htmlFor="profession" className="form-label">Profession</label>
                    <input
                        type="text"
                        className="form-control"
                        id="profession"
                        name="profession"
                        value={formData.profession}
                        onChange={handleChange}
                        required
                    />
                </div>

                {/* Skills Field */}
                <div className="mb-3">
                    <label htmlFor="skills" className="form-label">Skills (comma separated)</label>
                    <input
                        type="text"
                        className="form-control"
                        id="skills"
                        name="skills"
                        value={formData.skills}
                        onChange={handleChange}
                        required
                    />
                </div>

                {/* Submit Button */}
                <button type="submit" className="btn btn-primary">
                    Register
                </button>
            </form>

            {/* Display form data after submission */}
            {submitted && (
                <div className="mt-4">
                    <h4>Form Submitted Successfully!</h4>
                    <p><strong>Name:</strong> {formData.name}</p>
                    <p><strong>Phone:</strong> {formData.phone}</p>
                    <p><strong>Bio:</strong> {formData.bio}</p>
                    <p><strong>Location:</strong> {formData.location}</p>
                    <p><strong>Profession:</strong> {formData.profession}</p>
                    <p><strong>Skills:</strong> {formData.skills}</p>
                </div>
            )}
        </div>
      </div>
    </div>
  )
}
